import { axiosInstance } from "./axios"

export async function signIn_API(payload) {
   try {
      const response = await axiosInstance.post(
         `/account/login/NO_TOKEN`,
         payload,

      )

      return [null, response.data.access_token]
   } catch (error) {
      return [error, null]
   }
}
